import React from 'react';

function ProductCard({ product }) {
  return (
    <div className="product-card">
      <img style={{height:"5%"},{width:"5%"}} src={`http://localhost:5000${product.imageUrl}`} alt={product.name} />
      <h3>{product.name}</h3>
      <p>{product.description}</p>
      <p>${product.price}</p>
    </div>
  );
}

export default ProductCard;
